import React from 'react';
import style from './Prefeature.module.css'



function Prefeature(props) {

    return (
        <div >
            <div className={style.page+ ' ' + style.contact}></div>
            <div className={style.page+ ' ' + style.resume}></div>
            <div className={style.page+ ' ' + style.portfolio}></div>
            <div className={style.page+ ' ' + style.about}></div>
        </div>
    )
}

export default Prefeature;
